window.bookSummaryJSON = "<p><b>My father is back from the dead.</b></p> <p>He won't leave town without me, and no one can figure out why. Is it because of what I am? Does he want to use me as part of his religious cult? My mates are furious, and I can't help but feel like I have brought this trouble on them.</p> <p>The supernatural community is upset by the light I've brought on them with the rightful murder of my mother and Jed. My classmates have been swayed by the cruel rumors that my bully has put out. Worst of all? The boys keep saying I can shift, but I've had no luck. And what is this about a possible mating heat?</p> <p>I don't miss the basement, but it sure as heck was less complicated than this.</p> <p><i>This medium-burn paranormal shifter reverse harem features a naive but strong FMC with a troubled past and a secret about what she really is. Come meet Maya and her protective and possessive shifters! Intended for mature listeners.</i></p>"; 
